42	3			\N	2016-06-30 17:09:32.365716-07	2016-06-30 17:09:32.365744-07	f	f	We can run another Django application in production server(Nginx).\r\n\r\n1. Configure DNS server with host IP(192.168.12.5)\r\n\r\n* refer [this](http://ap.ftta.lan/wikiap_service_wiki/dns_configuration/) link for configuring DNS server\r\n\r\n* add your domain (eg. wiki) and map it to host server IP(192.168.12.5)\r\n\r\n* make sure DNS service restarted after configuration\r\n\r\n2. Edit hosts file \r\n* add IP (eg. 127.0.0.1) to the full URL\r\n\r\n        sudo nano /etc/hosts\r\n\r\n3. In hosting server, create directory to contain projects or web page\r\n\r\n        sudo mkdir ~/wiki \r\n        sudo nano  ~/wiki/index.html\r\n\r\n* edit index. html file \r\n\r\n4. Create server block for Nginx \r\n\r\n        cd /etc/nginx/sites-available\r\n        cp ap.conf <name>\r\n    \r\n5. In the new configuration file, add server block \r\n\r\n         server {\r\n           # the port your site will be served on\r\n           listen      80;\r\n\r\n           root /home/ftta-ap/wiki/;\r\n           index index.html index.htm;\r\n\r\n           server_name wiki.ftta.lan;\r\n           charset     utf-8;\r\n         }\r\n\r\n6. Create soft link to enable your web page\r\n\r\n        cd /etc/nginx/sites-enabled/\r\n        sudo ln -s ../sites-available/<your conf file> .\r\n\r\n7. Restart Nginx\r\n\r\n        sudo service nginx restart\r\n\r\nYou can also refer [this](http://albertogrespan.com/blog/running-multiple-domains-or-subdomains-in-nginx-with-server-blocks/) link	Sub Domain Configuration	10	38	2109
