55	18			\N	2016-07-01 17:26:36.573835-07	2016-07-01 17:26:36.573864-07	f	f	This will be wiki for all devops/networks related information documenting our network infrastructure and everything needed to maintain and develop our networks + servers in the FTTA.\r\n[[ftta_servers]]\r\n[TOC]\r\n\r\n# Network Administration\r\nThe Network Support Service is to help maintain the FTTA network infrastructure under LSM oversight. Please contact Brother Curt Kenard or Brother Joseph Bang with any questions.\r\n\r\n\r\n## Internet\r\nInternet access in the training is regulated and controlled by the FTTA firewall. Internet allowance is through the firewall and can be engaged either by the Web Access Request or input directly into the firewall. \r\n\r\n### Internet Schedule\r\n1. 24 Hour Recess - LD(5:45pm - 10:00pm) | Monday (7:30am - 6:45pm)\r\n2. Daily Schedule - No internet access / only server & printer access which is modified in Rule_0 on the firewall\r\n3. Designated Services - By use and project basis. Fellowship with overseers and TAs regarding specific times\r\n4. Events - Modify schedule according to the schedule given to the trainees. | Br. Curt Kenard takes care of the TraineeNet password\r\n### Installation\r\n1. LSM is responsible for all physical points of wireless service (Routers). Network Support (NS) takes care of the use of switches, localized routers and wireless peripherals\r\n2. All ports are maintained by LSM. All questions regarding physical ports should be through Brother Curt as the liaison between FTTA and LSM\r\n\r\n## Server Maintenance\r\nThere are three main servers that are used in the FTTA. Netguard (Firewall Administrator), FTTA Attendance Server (new and old) and FTTA Server (file server for all FTTA related data.\r\n\r\n## Printer Network\r\n### Printer IT Help\r\n### RICOH Printers\r\n## Technical Help\r\n\r\n\r\n	Networks Support Service Wiki	4	53	1781
56	1			\N	2016-07-06 15:37:31.258991-07	2016-07-06 15:37:31.259023-07	f	f	FTTA Firewall General Architecture\r\n\r\nFTTA is the only zone that the Sonic Wall firewall recognizes.\r\nfttaVPN users are treated as FTTA.\r\nMachines in FTTA can initiate connections to the internet.\r\nOfficenet and TraineeNet? are separated by Netguard, a machine that lives within the FTTA zone and runs a firewall program.\r\nImplications of general architecture and network separation\r\n\r\nRule set A is handled by the Sonic Wall firewall.\r\nRule set B is handled by the NetGuard? firewall.\r\nRule set B should be configured in the following manner:\r\nTraineeNet? can initiate file service to Officenet at all times.\r\nOfficenet can initiate all connections to TraineeNet? at all times.\r\nTraineeNet? can initiate web connections and web services through OfficeNet? at specified times (Trainees' Day Off).\r\nTraineeNet? can initiate web connections through Officenet at specified times and on specific devices (special internet requests).\r\nOfficenet\r\n\r\nManaged by LSM and Brother Curt Kennard\r\n\r\nTraineenet\r\n\r\nTraineeNet? is managed by Netguard Eth1 (static IP: 10.0.8.20) on Netguard interfaces with the WAN side of Traineenet.\r\nEth0 (static IP: 192.168.10.1) on Netguard interfaces with the LAN side of Traineenet.\r\n\r\nSecurity\r\n\r\nSecurity cameras (see DVR) and door keypads are also networked over Officenet.\r\n\r\nServers\r\n\r\nThis list should include all the machines located in the network_closet:\r\n\r\nAttendance\r\nNetguard\r\nModifying NetGuard\r\nThe following have been retired\r\n\r\nDispenser\r\nDispenser2\r\nGatekeeper\r\nWorkstations\r\n\r\nWorkstations on the FTTA network belong to one or more of the following categories: 1) Office; 2) Designated Service; 3) Attendance Stations. All workstations on Traineenet should have an entry in the firewall policy.\r\n\r\nOffice\r\n\r\nOffice workstations are those that are physically located in the front office, TA brothers' office, and back (library) offices. These machines have been placed on Officenet which gives them 24/7 internet access as well as access to Corporate (see Corporate on FTTA-Server).\r\n\r\nSupport Staff\r\n\r\nThese machines include all workstations used by FTTA serving ones that are not located in the front office. Such machines include Maintenance?, etc...\r\n\r\nDesignated Service\r\n\r\nAttendance Monitors, Special Projects, and other designated services may on occasion use workstations that have been provided for their use. In some cases, a workstation may be reserved for a single designated service group. These workstations should not be placed on Officenet.\r\n\r\nAttendance Stations\r\n\r\nAttendance stations (AS) are provided for trainees to access the Attendance Server. All attendance stations are on Traineenet. During the normal training schedule, internet access is limited to Sunday after team time through Monday before the Monday Night Revival meeting.\r\n\r\nSee attendance stations for detailed information.\r\n\r\nLaptops\r\n\r\nFTN laptops are provided for trainees' use. These laptops are stored in the TA brothers office. Trainees can check-out an FTN by entering their name in the FTTA Trainee Laptop binder located on the same shelf as the laptops.\r\n\r\nPrinters\r\n\r\nSee printers.	Old AP Network wiki (trac)	14	\N	1
57	1			\N	2016-07-06 15:38:46.976373-07	2016-07-06 15:38:46.976404-07	f	f	Netguard\r\nNetguard acts as the firewall, dynamic host configuration protocal (DHCP) server, domain name service (DNS) server, and router.\r\n\r\nName\tNetguard\r\nSystem Model\t\r\nOperating System\tUbuntu 14.04\r\nForm Factor\tTower\r\nCPU\t?\r\nMemory\t3GB\r\nNetwork\tOfficenet / Traineenet\r\nIP\t10.0.8.20 / 192.168.10.1\r\nFirewall\r\n\r\nIptables (service (technically its not really a service) iptables) is Ubuntu's default firewall package. Although Netguard acts as the primary firewall, Netguard-CP is the server used to modify the firewall's policies. Policies are modified on Netguard using FW Builder, compiled, and then installed to Netguard via SSH.\r\n\r\nDHCP\r\n\r\nDHCP3 (service dhcp3-server) is Ubuntu's default DHCP package. DHCP3 handles the leasing of IP addresses to all devices connected to Officenet and Traineenet.\r\n\r\nModify /etc/dhcp3/dhcpd.conf to add/remove a device (based upon its MAC address) to/from the DHCP IP assignment.\r\n\r\nRestart the service with sudo /etc/init.d/dhcp3-server restart.\r\n\r\nDNS\r\n\r\nBind9 is Ubuntu's default domain name service daemon. The FTTA network is split into two zones: Officenet and Traineenet. Bind9 is used to inform machines on the FTTA network of the aliases of various servers (like attendance.ftta.lan and dispenser.ftta.lan). Modify /etc/bind/zones/office.lan.db for Officenet and /etc/bind/zones/ftta.lan.db for Traineenet.\r\n\r\nIn the case that Netguard's DNS server IP addresses need to be updated, modify /etc/bind/named.conf.options.\r\n\r\nTraffic Monitoring\r\n\r\nNetguard has a bwm-ng (service bwm-ng), iftop (service iftop), and ntop (service ntop) installed to monitor bandwidth and network load.\r\n\r\nbwm-ng\r\n\r\nbwm-ng provides a high level view of current network load per NIC.\r\n\r\niftop\r\n\r\niftop listens to network traffic on a named interface and displays a table of current bandwidth usage by pairs of hosts. See image to right for explanation of the various columns on iftop's command interface. iftop explanation\r\n\r\nntop\r\n\r\nntop is a network traffic probe that shows the network usage. Unlike the other monitor tools, ntop employs a web interface that displays detailed traffic information on a per NIC / per host basis.\r\n\r\nAs of 12/30/12, ntop is started manually by ssh netguard and running command: sudo ntop -M -u root -i eth0,eth1,eth2,eth3 -d. This will start ntop in daemon mode.\r\n\r\nAccess ntop's web interface at http://10.0.8.20:3000 from Officenet or http://192.168.10.1:3000 from Traineenet. The username is 'admin' and the password is our standard admin password.\r\n\r\nRouter\r\n\r\nRedundancy\r\n\r\nOn 5/22/12, Allen Webb, David Lai, and Ben Friesen built Netguard2 as a back-up in case of a failure on Netguard. Netguard2 utilizes one on-board NIC and three PCI NICs (two of which are gigabit).	Old AP Netguard wiki	15	\N	1
58	19			\N	2016-07-13 10:23:57.157631-07	2016-07-13 10:23:57.157661-07	f	f	This will be wiki for all devops/networks related information documenting our network infrastructure and everything needed to maintain and develop our networks + servers in the FTTA.\r\n[[ftta_servers]]\r\n[TOC]\r\n\r\n[article_list depth:2]\r\n\r\n# Network Administration\r\nThe Network Support Service is to help maintain the FTTA network infrastructure under LSM oversight. Please contact Brother Curt Kenard or Brother Joseph Bang with any questions.\r\n\r\n\r\n## Internet\r\nInternet access in the training is regulated and controlled by the FTTA firewall. Internet allowance is through the firewall and can be engaged either by the Web Access Request or input directly into the firewall. \r\n\r\n### Internet Schedule\r\n1. 24 Hour Recess - LD(5:45pm - 10:00pm) | Monday (7:30am - 6:45pm)\r\n2. Daily Schedule - No internet access / only server & printer access which is modified in Rule_0 on the firewall\r\n3. Designated Services - By use and project basis. Fellowship with overseers and TAs regarding specific times\r\n4. Events - Modify schedule according to the schedule given to the trainees. | Br. Curt Kenard takes care of the TraineeNet password\r\n### Installation\r\n1. LSM is responsible for all physical points of wireless service (Routers). Network Support (NS) takes care of the use of switches, localized routers and wireless peripherals\r\n2. All ports are maintained by LSM. All questions regarding physical ports should be through Brother Curt as the liaison between FTTA and LSM\r\n\r\n## Server Maintenance\r\nThere are three main servers that are used in the FTTA. Netguard (Firewall Administrator), FTTA Attendance Server (new and old) and FTTA Server (file server for all FTTA related data.\r\n\r\n## Printer Network\r\n### Printer IT Help\r\n### RICOH Printers\r\n## Technical Help\r\n\r\n\r\n	Networks Support Service Wiki	4	55	1798
59	2			\N	2016-07-13 10:30:23.125781-07	2016-07-13 10:30:23.12581-07	f	f	FTTA Firewall General Architecture\r\n\r\n![Network Architecture](http://ap.ftta.lan/media/wiki/images/14/4b6b566b2a89477d8d7454524e520df1/8f3c9b1cd8791fded3520b066ef5f96ce96fb3f7.png)\r\n\r\n\r\nFTTA is the only zone that the Sonic Wall firewall recognizes.\r\nfttaVPN users are treated as FTTA.\r\nMachines in FTTA can initiate connections to the internet.\r\nOfficenet and TraineeNet? are separated by Netguard, a machine that lives within the FTTA zone and runs a firewall program.\r\nImplications of general architecture and network separation\r\n\r\nRule set A is handled by the Sonic Wall firewall.\r\nRule set B is handled by the NetGuard? firewall.\r\nRule set B should be configured in the following manner:\r\nTraineeNet? can initiate file service to Officenet at all times.\r\nOfficenet can initiate all connections to TraineeNet? at all times.\r\nTraineeNet? can initiate web connections and web services through OfficeNet? at specified times (Trainees' Day Off).\r\nTraineeNet? can initiate web connections through Officenet at specified times and on specific devices (special internet requests).\r\nOfficenet\r\n\r\nManaged by LSM and Brother Curt Kennard\r\n\r\nTraineenet\r\n\r\nTraineeNet? is managed by Netguard Eth1 (static IP: 10.0.8.20) on Netguard interfaces with the WAN side of Traineenet.\r\nEth0 (static IP: 192.168.10.1) on Netguard interfaces with the LAN side of Traineenet.\r\n\r\nSecurity\r\n\r\nSecurity cameras (see DVR) and door keypads are also networked over Officenet.\r\n\r\nServers\r\n\r\nThis list should include all the machines located in the network_closet:\r\n\r\nAttendance\r\nNetguard\r\nModifying NetGuard\r\nThe following have been retired\r\n\r\nDispenser\r\nDispenser2\r\nGatekeeper\r\nWorkstations\r\n\r\nWorkstations on the FTTA network belong to one or more of the following categories: 1) Office; 2) Designated Service; 3) Attendance Stations. All workstations on Traineenet should have an entry in the firewall policy.\r\n\r\nOffice\r\n\r\nOffice workstations are those that are physically located in the front office, TA brothers' office, and back (library) offices. These machines have been placed on Officenet which gives them 24/7 internet access as well as access to Corporate (see Corporate on FTTA-Server).\r\n\r\nSupport Staff\r\n\r\nThese machines include all workstations used by FTTA serving ones that are not located in the front office. Such machines include Maintenance?, etc...\r\n\r\nDesignated Service\r\n\r\nAttendance Monitors, Special Projects, and other designated services may on occasion use workstations that have been provided for their use. In some cases, a workstation may be reserved for a single designated service group. These workstations should not be placed on Officenet.\r\n\r\nAttendance Stations\r\n\r\nAttendance stations (AS) are provided for trainees to access the Attendance Server. All attendance stations are on Traineenet. During the normal training schedule, internet access is limited to Sunday after team time through Monday before the Monday Night Revival meeting.\r\n\r\nSee attendance stations for detailed information.\r\n\r\nLaptops\r\n\r\nFTN laptops are provided for trainees' use. These laptops are stored in the TA brothers office. Trainees can check-out an FTN by entering their name in the FTTA Trainee Laptop binder located on the same shelf as the laptops.\r\n\r\nPrinters\r\n\r\nSee printers.\r\n\r\n[image:12]\r\n    Network Architecture	Old AP Network wiki (trac)	14	56	1798
60	3			\N	2016-07-13 10:39:24.021685-07	2016-07-13 10:39:24.021715-07	f	f	_Note: This should be one of the most comprehensive pages in the wiki, as it should mention most of the devices on the network by name (with corresponding links)._\r\n\r\n### Network Design\r\nThis page provides an overview of the FTTA's physical network and its attached devices. Such devices include: servers, desktops, laptops, printers, routers, switches, and wireless access points.\r\n\r\n### Network Architecture\r\n\r\n![Network Architecture](http://ap.ftta.lan/media/wiki/images/14/4b6b566b2a89477d8d7454524e520df1/8f3c9b1cd8791fded3520b066ef5f96ce96fb3f7.png)\r\n\r\n### FTTA Firewall General Architecture\r\n\r\n1. FTTA is the only zone that the Sonic Wall firewall recognizes.\r\n2. fttaVPN users are treated as FTTA.\r\n3. Machines in FTTA can initiate connections to the internet.\r\n4. Officenet and TraineeNet? are separated by Netguard, a machine that lives within the FTTA zone and runs a firewall program.\r\n\r\n### Implications of general architecture and network separation\r\n\r\n1. Rule set A is handled by the Sonic Wall firewall.\r\n2. Rule set B is handled by the NetGuard? firewall.\r\n3. Rule set B should be configured in the following manner:\r\n    - TraineeNet? can initiate file service to Officenet at all times.\r\n    - Officenet can initiate all connections to TraineeNet? at all times.\r\n    - TraineeNet? can initiate web connections and web services through OfficeNet? at specified times (Trainees' Day Off).\r\n    - TraineeNet? can initiate web connections through Officenet at specified times and on specific devices (special internet requests).\r\n\r\n### Officenet\r\n\r\nManaged by LSM and Brother Curt Kennard\r\n\r\n### Traineenet\r\n\r\nTraineeNet? is managed by Netguard Eth1 (static IP: **10.0.8.20**) on Netguard interfaces with the WAN side of Traineenet.\r\nEth0 (static IP: **192.168.10.1**) on Netguard interfaces with the LAN side of Traineenet.\r\n\r\n### Security\r\n\r\nSecurity cameras (see DVR) and door keypads are also networked over Officenet.\r\n\r\n### Servers\r\n\r\nThis list should include all the machines located in the network_closet:\r\n\r\n - Attendance\r\n - Netguard\r\n - Modifying NetGuard\r\n\r\nThe following have been retired\r\n\r\n - Dispenser\r\n - Dispenser2\r\n - Gatekeeper\r\n\r\n### Workstations\r\n\r\nWorkstations on the FTTA network belong to one or more of the following categories: 1) Office; 2) Designated Service; 3) Attendance Stations. All workstations on Traineenet should have an entry in the firewall policy.\r\n\r\n### Office\r\n\r\nOffice workstations are those that are physically located in the front office, TA brothers' office, and back (library) offices. These machines have been placed on Officenet which gives them 24/7 internet access as well as access to Corporate (see Corporate on FTTA-Server).\r\n\r\n### Support Staff\r\n\r\nThese machines include all workstations used by FTTA serving ones that are not located in the front office. Such machines include Maintenance?, etc...\r\n\r\n### Designated Service\r\n\r\nAttendance Monitors, Special Projects, and other designated services may on occasion use workstations that have been provided for their use. In some cases, a workstation may be reserved for a single designated service group. These workstations should not be placed on Officenet.\r\n\r\n### Attendance Stations\r\n\r\nAttendance stations (AS) are provided for trainees to access the Attendance Server. All attendance stations are on Traineenet. During the normal training schedule, internet access is limited to Sunday after team time through Monday before the Monday Night Revival meeting.\r\n\r\nSee attendance stations for detailed information.\r\n\r\n#### Laptops\r\n\r\nFTN laptops are provided for trainees' use. These laptops are stored in the TA brothers office. Trainees can check-out an FTN by entering their name in the FTTA Trainee Laptop binder located on the same shelf as the laptops.\r\n\r\n#### Printers\r\n\r\nSee printers.\r\n\r\n[image:12]\r\n    Network Architecture	Old AP Network wiki (trac)	14	59	1798
61	2			\N	2016-07-13 11:21:47.569315-07	2016-07-13 11:21:47.569346-07	f	f	Netguard\r\n========\r\n\r\nNetguard acts as the \\[\\#Firewall firewall\\], dynamic host configuration\r\nprotocal (\\[\\#DHCP DHCP\\]) server, domain name service (\\[\\#DNS DNS\\])\r\nserver, and \\[\\#Router router\\].\r\n\r\n||**Name**||Netguard|| ||**System Model**|||| ||**Operating\r\nSystem**||Ubuntu 14.04|| ||**Form Factor**||Tower|| ||**CPU**||?||\r\n||**Memory**||3GB|| ||**Network**||Officenet / Traineenet||\r\n||**IP**||10.0.8.20 / 192.168.10.1||\r\n\r\nFirewall\r\n--------\r\n\r\n[Iptables](https://help.ubuntu.com/community/IptablesHowTo) (service\r\n(technically its not really a *service*) \\`iptables\\`) is Ubuntu's\r\ndefault firewall package. Although Netguard acts as the primary\r\nfirewall, \\[wiki:Netguard-CP\\] is the server used to modify the\r\nfirewall's policies. Policies are modified on Netguard using\r\n\\[wiki:Netguard-CP\\#FW\\_Builder FW Builder\\], compiled, and then\r\ninstalled to Netguard via SSH.\r\n\r\nDHCP\r\n----\r\n\r\n[DHCP3](https://help.ubuntu.com/community/dhcp3-server) (service\r\n\\`dhcp3-server\\`) is Ubuntu's default DHCP package. DHCP3 handles the\r\nleasing of IP addresses to all devices connected to\r\n\\[wiki:network\\_design\\#Officenet Officenet\\] and\r\n\\[wiki:network\\_design\\#Traineenet Traineenet\\].\r\n\r\nModify \\`/etc/dhcp3/dhcpd.conf\\` to add/remove a device (based upon its\r\nMAC address) to/from the DHCP IP assignment.\r\n\r\nRestart the service with \\`sudo /etc/init.d/dhcp3-server restart\\`.\r\n\r\nDNS\r\n---\r\n\r\n[Bind9](https://help.ubuntu.com/community/BIND9ServerHowto) is Ubuntu's\r\ndefault domain name service daemon. The FTTA network is split into two\r\nzones: Officenet and Traineenet. Bind9 is used to inform machines on the\r\nFTTA network of the aliases of various servers (like attendance.ftta.lan\r\nand dispenser.ftta.lan). Modify \\`/etc/bind/zones/office.lan.db\\` for\r\nOfficenet and \\`/etc/bind/zones/ftta.lan.db\\` for Traineenet.\r\n\r\nIn the case that Netguard's DNS server IP addresses need to be updated,\r\nmodify \\`/etc/bind/named.conf.options\\`.\r\n\r\nTraffic Monitoring\r\n------------------\r\n\r\nNetguard has a [bwm-ng](http://www.gropp.org/?id=projects&sub=bwm-ng)\r\n(service \\`bwm-ng\\`), [iftop](http://www.ex-parrot.com/pdw/iftop/)\r\n(service \\`iftop\\`), and [ntop](http://www.ntop.org/products/ntop/)\r\n(service \\`ntop\\`) installed to monitor bandwidth and network load.\r\n\r\n### bwm-ng\r\n\r\nbwm-ng provides a high level view of current network load per NIC.\r\n\r\n### iftop\r\n\r\niftop listens to network traffic on a named interface and displays a\r\ntable of current bandwidth usage by pairs of hosts. See image to right\r\nfor explanation of the various columns on iftop's command interface.\r\n[Image(topandiftopguide.png, 10%,\r\nright)](Image(topandiftopguide.png,_10%,_right) "wikilink")\r\n\r\n### ntop\r\n\r\nntop is a network traffic probe that shows the network usage. Unlike the\r\nother monitor tools, ntop employs a web interface that displays detailed\r\ntraffic information on a per NIC / per host basis.\r\n\r\nAs of 12/30/12, ntop is started manually by \\`ssh netguard\\` and running\r\ncommand: \\`sudo ntop -M -u root -i eth0,eth1,eth2,eth3 -d\\`. This will\r\nstart ntop in daemon mode.\r\n\r\nAccess ntop's web interface at <http://10.0.8.20:3000> from Officenet or\r\n<http://192.168.10.1:3000> from Traineenet. The username is 'admin' and\r\nthe password is our standard admin password.\r\n\r\nRouter\r\n------\r\n\r\nRedundancy\r\n----------\r\n\r\nOn 5/22/12, Allen Webb, David Lai, and Ben Friesen built\r\n\\[wiki:Netguard2\\] as a back-up in case of a failure on Netguard.\r\nNetguard2 utilizes one on-board NIC and three PCI NICs (two of which are\r\ngigabit).\r\n	Old AP Netguard wiki	15	57	1798
