68.10.1**) on\r\nNetguard interfaces with the LAN side of Traineenet.\r\n\r\n#### Security\r\n\r\nSecurity cameras (see \\[wiki:DVR\\]) and door keypads are also networked\r\nover Officenet.\r\n\r\n### Servers\r\n\r\nThis list should include all the machines located in the network_closet:\r\n\r\n - Attendance\r\n - Netguard\r\n - Modifying NetGuard\r\n\r\nThe following have been retired\r\n\r\n - Dispenser\r\n - Dispenser2\r\n - Gatekeeper\r\n\r\n### Workstations\r\n\r\nWorkstations on the FTTA network belong to one or more of the following\r\ncategories: 1) Office; 2) Designated Service; 3) Attendance Stations.\r\nAll workstations on Traineenet should have an entry in the\r\n\\[wiki:Netguard\\#Firewall firewall\\] policy.\r\n\r\n#### Office\r\n\r\nOffice workstations are those that are physically located in the front\r\noffice, TA brothers' office, and back (library) offices. These machines\r\nhave been placed on \\[wiki:Officenet\\] which gives them 24/7 internet\r\naccess as well as access to Corporate (see \\[wiki:FTTA-Server\\#Corporate\r\nCorporate\\] on \\[wiki:FTTA-Server\\]).\r\n\r\n#### Support Staff\r\n\r\nThese machines include all workstations used by FTTA serving ones that\r\nare not located in the front office. Such machines include\r\n\\[wiki:Maintenance\\], etc...\r\n\r\n#### Designated Service\r\n\r\nAttendance Monitors, Special Projects, and other designated services may\r\non occasion use workstations that have been provided for their use. In\r\nsome cases, a workstation may be reserved for a single designated\r\nservice group. These workstations should not be placed on\r\n\\[wiki:Officenet\\].\r\n\r\n#### Attendance Stations\r\n\r\nAttendance stations (AS) are provided for trainees to access the\r\n\\[wiki:Attendance Attendance Server\\]. All attendance stations are on\r\nTraineenet. During the normal training schedule, internet access is\r\nlimited to Sunday after team time through Monday before the Monday Night\r\nRevival meeting.\r\n\r\nSee \\[wiki:attendance\\_stations attendance stations\\] for detailed\r\ninformation.\r\n\r\n### Laptops\r\n\r\n\\[wiki:"FTN laptops" FTN laptops\\] are provided for trainees' use. These\r\nlaptops are stored in the TA brothers office. Trainees can check-out an\r\nFTN by entering their name in the FTTA Trainee Laptop binder located on\r\nthe same shelf as the laptops.\r\n\r\n### Printers\r\n\r\nSee \\[wiki:printers\\].\r\n\r\n\r\n[image:12]\r\n    Network Architecture	Old AP Network wiki (trac)	14	60	1798
63	1			\N	2016-07-13 11:28:00.513062-07	2016-07-13 11:28:00.513092-07	f	f	Modifying Netguard\r\n==================\r\n\r\nNetguard is primarily used to modify the firewall on \\[wiki:Netguard\\].\r\nUse FW Builder to open the file \\`ftta.fwb\\`.\r\n\r\n192.168.1.15\r\n\r\nSchedule\r\n--------\r\n\r\nThe schedules for the firewall must be modified to reflect the modified\r\ntraining schedule during conferences and at other times. Use FW Builder\r\non Netguard.\r\n\r\nFW Builder\r\n----------\r\n\r\nBelow is the procedure for modifying the firewall: 1. Open \\`ftta.fwb\\`\r\n2. Save \\`ftta.fwb\\` as */home/ftta/Documents/Current Firewall*\r\naccording to the following format: \\`FTTA-YEAR-MO-DAY.fwb\\`. An example\r\nwould be: \\`ftta-2012-12-05.fwb\\` 3. Reopen \\`ftta.fwb\\` 4. Modify as\r\nneeded 5. Press "Install" and follow directions 6. Open terminal 7. Run\r\ncommand \\`sudo killall java\\` (kills the service related to web-access\r\nrequests from \\[wiki:Attendance\\]) 8. Run command \\`sudo service\r\nnetworkApp start\\` (starts the above service) 9. Save \\`ftta.fwb\\` 10.\r\nClose FW Builder\r\n\r\nOpenNMS\r\n-------\r\n\r\nOn 12/30/12, [OpenNMS](http://http://en.wikipedia.org/wiki/OpenNMS) was\r\ndiscovered on netguard-CP and can be accessed at\r\n<http://localhost:8980>. Username 'admin' and standard password.\r\n\r\n------------------------------------------------------------------------\r\n\r\nUnknown Scripts from the posts\r\n------------------------------\r\n\r\n1./home/ftta/Documents/backup-scripts/freenas[BR](BR "wikilink")\r\n\r\n(the above is related to an automated back-up)[BR](BR "wikilink")\r\n\r\n2./home/ftta/Documents/backup-scripts/freenas-backup.sh[BR](BR "wikilink")\r\n\r\nrsync [BR](BR "wikilink")\r\n\r\n`SRC/home/ftta`[`BR`](BR "wikilink")\r\n\r\n`destination/home/ftta/sufs?/net.../netguard`[`BR`](BR "wikilink")\r\n\r\nchmod a+x ...... /freenas-backup.sh[BR](BR "wikilink")\r\n\r\n1.  !/bin/sh\r\n\r\n	Old AP Netguard CP wiki	16	\N	1798
