opbox://repos/dj_ap_server\r\n```\r\n\r\n\r\nsomewhere outside this folder to checkout the git repository.\r\n\r\nThen, you must checkout the ```database``` branch by doing:\r\n\r\n```\r\ngit checkout database\r\n```\r\n\r\nThere should then be 3 files:\r\n\r\nap_data.sql  ap_full.sql  ap_schema.sql\r\n\r\n#### Scripts\r\nYou can checkout the scripts on the ```scrips``` branch by:\r\n\r\n```\r\ngit checkout scripts\r\n```\r\n\r\n#### Files tracked currently:\r\n - ap.ini -> uwsgi uses this file for configuration. Soft link to: /etc/uwsgi/sites/ap.ini\r\n - ap_ssl.conf -> used by nginx. Soft link to: /etc/nginx/sites-enabled/ap_ssl.conf\r\n - production.sh -> pulls in latest changes from git repo, backs up db, migrate, collect static, restart server.\r\nSoft link to: /home/ftta-ap/\r\n\r\n - uwsgi.conf -> This script needs to be placed in /etc/init. Used to start, stop, restart uwsgi.conf. (ex. service     uwsgi start)\r\n - ssh-find-agent.sh -> Keeps only 1 ssh-agent running in all ssh sessions so passphrase don't have to be added.\r\nSoft link to: /home/ftta-ap/\r\n - cloud.conf -> This script starts up the cloud server. Soft link to: /etc/nginx/sites-enabled/could.conf\r\n \r\n - .bashrc -> This script is custom configuration for your terminal. Soft link to ~/.bashrc\r\n\r\nShorthand for editing bashrc is: ```editb``` and to source it is: ```sourceb```\r\n\r\n	Production Server (ap.ftta.lan)	21	75	1798
